import React, { Component } from 'react';
import Auxiliary from '../../../../../util/Auxiliary';
import { Modal, ModalHeader } from 'reactstrap';
import IntlMessages from '../../../../../util/IntlMessages';
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import Fab from '@material-ui/core/Fab';
import Chip from '@material-ui/core/Chip';

var dateFormat = require('dateformat');

export default class ShowVirtualClass extends Component {
  render() {
    const sys = Date.parse(new Date()) / 60000;
    const start =
      Date.parse(
        this.props.ClassVirtualObject.date_virtual_class.slice(0, 10) +
        ' ' +
        this.props.ClassVirtualObject.start_time_class
      ) / 60000;
    const end =
      Date.parse(
        this.props.ClassVirtualObject.date_virtual_class.slice(0, 10) +
        ' ' +
        this.props.ClassVirtualObject.end_time_class
      ) / 60000;

    const duration =
      Math.floor((end - start) / 60) +
      ' heures , ' +
      ((end - start) % 60) +
      ' minutes ';
    const statusClass =
      start > sys ? 'programmée' : end > sys ? 'en progré' : 'terminée';
    const statusStyle = statusClass.includes('terminée')
      ? 'text-white bg-danger'
      : statusClass.includes('en progré')
        ? 'bg-amber'
        : 'text-white bg-success';
    return (
      <Auxiliary>
        <Modal
          className="modal-box modal-box-mail"
          isOpen={true}
          style={{ zIndex: 2600 }}
        >
          <ModalHeader
            className="modal-box-header bg-primary text-white"
            toggle={this.props.cancelModal}
            align="right"
          >
          </ModalHeader>
          <div className="module-detail mail-detail">
            <div className="jr-card text-center">
              <div className={`jr-card-header-color bg-gradient-primary`}>
                <div className="jr-card-header-top">
                  <div>
                    <h3 className="mb-0 text-white">
                      {dateFormat(new Date())}
                    </h3>
                  </div>
                </div>

                <img
                  className="rounded-circle size-90 avatar-shadow mb-3"
                  src="https://pngimage.net/wp-content/uploads/2018/05/admin-avatar-png-1.png"
                  alt="Team Member"
                />

                <div className="jr-card-hd-content">
                  <h4 className="mb-0 text-white">{this.props.ClassVirtualObject.ProfessorName}</h4>
                </div>
              </div>
              <div className="jr-card-body pt-2">
                <p className="message">
                  <font size="+2"> {this.props.ClassVirtualObject.object}</font>
                </p>

                <div>
                  <div>
                    <strong>
                      <IntlMessages id="ticket.name.class" /> : {this.props.ClassVirtualObject.ClassName}
                    </strong>
                  </div>
                  <div>
                    <strong>
                      <IntlMessages id="components.note.subject" /> : {this.props.ClassVirtualObject.SubjectName}
                    </strong>
                  </div>
                  <div>
                    <strong>
                      <IntlMessages id="components.virtual.class.url" /> :

                      <a href={this.props.ClassVirtualObject.class_url} target="_blank"><IntlMessages id="clic.here" /></a>

                    </strong>
                  </div>
                  <div>
                    <strong>
                      <IntlMessages id="appModule.password" /> : {this.props.ClassVirtualObject.password}
                    </strong>
                  </div>
                  <div>
                    <strong>
                      <IntlMessages id="class.virtual.duration" /> : {duration}
                    </strong>
                  </div>
                  <div>
                    <Chip
                      variant="outlined"
                      size="small"
                      label={statusClass}
                      className={` badge text-uppercase ${statusStyle}`}
                    />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </Modal>
      </Auxiliary>
    );
  }
}
